import React from 'react';

class CountryFilter extends React.Component {
    render() {
        let {countryList} = this.props;
        console.log("CountryList = " + countryList);
        let Countries = countryList.map((country) => (
                <li>{country}</li>
        ));
        console.log("Countries = " + Countries); 
        return (
            <div>
                <h3>
                    COUNTRY
                </h3>
                <ul>
                    {Countries}
                </ul>
            </div>
        );
    }
}

export {CountryFilter}
